import React, { Component } from 'react'
import './index.css'
export default class Thirty extends Component {
    render() {
        // console.log('About组件收到的props是',this.props);
        return (
            <div className="thirtyMain" >
                {/* 重点研发30个app */}
                <div className="differDomain">
                    <div className="differApp1">
                        <div className="top1">
                            <span>优化控制域</span>
                        </div>
                        <div className="buttom1" ></div>
                    </div>
                    <div className="jianju"></div>
                    <div className="differApp2">生产管控域</div>
                    <div className="jianju"></div>
                    <div className="differApp3">设备运维域</div>
                    <div className="jianju"></div>
                    <div className="differApp4">安全环保域</div>
                    <div className="jianju"></div>
                    <div className="differApp5">能源管控域</div>
                </div>
            </div>
        )
    }
}
